function ViewSphere() {
	this.time = Math.random() * 0xFFFF;
	bongiovi.View.call(this, glslify("../shaders/sphere.vert"), glslify("../shaders/sphere.frag"));
}

var p = ViewSphere.prototype = new bongiovi.View();
p.constructor = ViewSphere;


p._init = function() {
	gl = GL.gl;
	var positions = [];
	var coords = [];
	var indices = []; 
	var centers = [];
	var normals = [];
	var count = 0;


	function getNormal(p0, p1, p2) {
		var pp0 = vec3.clone(p0);
		var pp1 = vec3.clone(p1);
		var pp2 = vec3.clone(p2);
		var v0 = vec3.create();
		var v1 = vec3.create();
		var n = vec3.create();
		vec3.sub(v0, pp1, pp0);
		vec3.sub(v1, pp2, pp0);

		vec3.cross(n, v0, v1);
		vec3.normalize(n, n);

		return n;
	}

	function getCenter(p0, p1, p2) {
		var x = (p0[0] + p1[0] + p2[0])/3;
		var y = (p0[1] + p1[1] + p2[1])/3;
		var z = (p0[2] + p1[2] + p2[2])/3;

		return [x, y, z];
	}

	function addFace(p0, p1, p2, c) {
		// var c = getCenter(p0, p1, p2);
		var n = getNormal(p0, p1, p2);

		positions.push(p0);
		positions.push(p1);
		positions.push(p2);

		centers.push(c);
		centers.push(c);
		centers.push(c);

		normals.push(n);
		normals.push(n);
		normals.push(n);

		coords.push([0, 0]);
		coords.push([0, 0]);
		coords.push([0, 0]);

		indices.push(count*3);
		indices.push(count*3+1);
		indices.push(count*3+2);

		count ++;
	}

	function getInnerPoint(c) {
		var s = .8;
		return [c[0]*s, c[1]*s, c[2]*s];
	}


	function addPyramid(p0, p1, p2) {
		var c = getCenter(p0, p1, p2);

		addFace(p0, p1, p2, c);
		addFace(getInnerPoint(c), p1, p0, c);
		addFace(getInnerPoint(c), p2, p1, c);
		addFace(getInnerPoint(c), p0, p2, c);
	}

	for(var i=0; i<faces.length; i++) {
		var f = faces[i];
		var i0 = f[0]-1;
		var i1 = f[1]-1;
		var i2 = f[2]-1;

		var p0 = vertices[i0];
		var p1 = vertices[i1];
		var p2 = vertices[i2];

		addPyramid(p0, p1, p2);
	}

	this.mesh = new bongiovi.Mesh(positions.length, indices.length, GL.gl.TRIANGLES);
	this.mesh.bufferVertex(positions);
	this.mesh.bufferTexCoords(coords);
	this.mesh.bufferIndices(indices);
	this.mesh.bufferData(centers, 'aCenter', 3);
	this.mesh.bufferData(normals, 'aNormal', 3);
};

p.render = function(texture) {
	this.time += .003;
	this.shader.bind();
	this.shader.uniform("time", "uniform1f", this.time);
	if(texture) {
		this.shader.uniform("texture", "uniform1i", 0);
		texture.bind(0);	
	}
	
	GL.draw(this.mesh);
};

module.exports = ViewSphere;